import 'tachyons';
import {Cats} from './Cats';

ReactDOM.render(
			<React.StrictMode>, 
				<div>
					<Card id={cats[0].id} name={cats[0].name} email={email[0].email}/>
					<Card id={cats[1].id} name={cats[1].name} email={email[1].email}/>
					<Card id={cats[2].id} name={cats[2].name} email={email[2].email}/>
				</div>
			</React.StrictMode>, 
			document.getElementById('root'));

